    false,nt"url": null,nt"notes": "Between January and March 2010, lidar data
    was collected in southeast/coastal Georgia under a multi-agency partnership between
    the Coastal Georgia Regional Development Center, USGS, FEMA, NOAA and local county
    governments. Data acquisition is for the full extent of coastal Georgia, approximately
    50 miles inland, excluding counties with existing high-resolution lidar derived
    elevation data. The data capture area consists of an area of approximately 5703
    square miles. This project is within the Atlantic Coastal Priority Area as defined
    by the National Geospatial Program (NGP) and supports homeland security requirements
    of the National Geospatial-Intelligence Agency (NGA). This project also supports
    the National Spatial Data Infrastructure (NSDI) and will advance USGS efforts related
    to The National Map and the National Elevation Dataset. The data were delivered
    in LAS format version 1.2 in 5000 x 5000 foot tiles. The data are classified according
    to ASPRS LAS 1.2 classification scheme: Class 1 - Unclassified Class 2 - Bare Earth
    Class 7 - Low Point (Noise) Class 9 - Water Class 10 - Land below sea level Class
    12 - Overlap",nt"license_title": null,nt"extras": [{ntt"key": "bbox-east-long",ntt"value":
